// ==UserScript==
// @name         AcFun视频播放变速
// @namespace    ac-video-rate
// @version      0.1.0
// @description  acfun网页视频播放,添加了变速快捷按钮，比自带的变速可用更频繁的变速， 测试了edge和chrome 运行正常,23-1-12
// @author       zip11guge
// @match        https://www.acfun.cn/v/*

// @icon64        data:image/x-icon;base64,


// @run-at document-end
// @license      MIT

// @downloadURL https://update.greasyfork.org/scripts/458066/AcFun%E8%A7%86%E9%A2%91%E6%92%AD%E6%94%BE%E5%8F%98%E9%80%9F.user.js
// @updateURL https://update.greasyfork.org/scripts/458066/AcFun%E8%A7%86%E9%A2%91%E6%92%AD%E6%94%BE%E5%8F%98%E9%80%9F.meta.js
// ==/UserScript==

(function() {
    'use strict';

    //搜索黑块自定义偏移位置
    // 黑块位置不合适，脚本内容搜索黑块自定义偏移位置，修改加号后的偏移数字，调整到合适的位置

    // new div1
    let div1=document.createElement("div");


    //div1 text
    div1.innerHTML=`<span class="v2">(2x) </span><span class="v15">(1.5x)  </span><span class="v125">(1.25x)
    </span><span class="v1">(1x)  </span> </span>`;


    // div1 click
    div1.onclick=function(event){


        // click speed
        switch (event.target.className) {
            case "v2" :
                playspeed(2);
                break;
            case "v15":
                playspeed(1.5);
                break;
            case "v125":
                playspeed(1.25);
                break;
            case "v1" :
                playspeed(1);
                break;

        }
    };


    // append div1 button

    document.body.append(div1);

    //css样式为

    // position:fixed; 生成固定定位的元素，相对于浏览器窗口进行定位。元素的位置通过 "left", "top", "right" 以及 "bottom" 属性进行规定。
    // position:absolute; 用绝对定位,一个元素可以放在页面上的任何位置

    //z-index:999; 元素设置最上

    //bottom:15px;距窗口底部15px
    //right:15px;距窗口右边15px
    //width:60px;内容的宽度60px
    //height:60px;内容的高度60px

    //background:black;内边距的颜色和内容的颜色设置为黑色，不包括外边距和边框
    //opacity:0.75;不透明度设置为0.75，1为完全不透明
    //color:white;指定文本的颜色为白色

    //text-align:center;指定元素文本的水平对齐方式为居中对齐
    //text-align:justify实现两端对齐文本效果。

    //line-height:60px;设置行高，通过设置为等于该元素的内容高度的值，配合text-align:center;可以使div1的文字居中
    //cursor:pointer;定义了鼠标指针放在一个元素边界范围内时所用的光标形状为一只手


    // share pos- windows start-----------

    var box = document.getElementsByClassName("title")[0];

    var pos = box.getBoundingClientRect();

    // alert( "top:"+pos.top +
    //     "left:"+pos.left +
    //     "bottom:"+pos.bottom +
    //     "right:"+pos.right +
    //     "width:"+pos.width +
    //     "height:"+pos.height);

    // share pos End -------------

    //搜索黑块自定义偏移位置
    let sleft=pos.left+560;
    // div1 left 左位置

    let stop=pos.top;

    // div1 top 上边缘 位置

    div1.style = "position:absolute;z-index:999;top:"+stop+"px;left:"+sleft+"px;width:220px;height:30px;background:black;opacity:0.75;color:white;text-align:center;line-height:30px;cursor:pointer;";






    // set video rate

    function playspeed(sd) {

        var xy1 = document.querySelector("video");

        console.log(xy1);

        xy1.playbackRate = sd;

        console.log("video-speed:"+sd);

    }





})();